import React from 'react';
import {Diff,  Hunk, parseDiff } from 'react-diff-view';
import { createTwoFilesPatch } from 'diff';
import 'react-diff-view/style/index.css';



const OldCode = `
// This is the old code
function add(a, b) {
  return a + b;
}
`;

const NewCode = `
// This is the new code
function add(a, b) {
  return a + b + 1; // Added 1 to the result
}
`;


const CodeDifferentiator = ({ oldCode, newCode }) => {
  const diff = createTwoFilesPatch('oldCode', 'newCode', oldCode, newCode, '', '', { context: 5 });
  const hunks = parseDiff(diff);

  return <Diff hunks={hunks} />;
};

function App() {
  return (
    <div className="App">
      <h1>Code Diff Example</h1>
      <CodeDifferentiator oldCode={OldCode} newCode={NewCode} />

    </div>
  );
}

export default App;
